import React from 'react';

const style = {
    main: {
        display: 'flex',
        height: '100%',
        width: '100%',
        background: '#ff773b'
    },
    divInfo: {
        display: 'flex',
        justifyContent:'center',
        alignItems:'center',
        height: '100%',
        width: '60%'
    },
    sectionInfo: {
        height:'100%',
        width:'100%',
        color:'#ffffff'
    },
    divLogin: {
        height: '100%',
        width: '40%'
    }
}

const Login = () => {
    return (
        <main style={style.main}>
            <div style={style.divInfo}>
                <section style={style.sectionInfo}>
                    <h1>Gerencie o conte√∫do que seus clientes veem</h1>
                </section>
            </div>
            <div style={style.divLogin}>
                <section>

                </section>
            </div>
        </main>
    )
}

export default Login
